import React from 'react'


export default class Starwars extends React.Component {
    constructor(){
        super()
        this.state={
          person : []
        }
      }
      componentDidMount() {
        fetch('https://api.twitter.com/1.1/lists/members.json?list_id=1130185227375038465&cursor=-1&skip_status=true')
          .then(response => {return response.json()})
          .then(data => this.setState({person: data})
        )       
        console.log(this.state.person)

    } 
    render(){
        return (
        <div>
            <h1>
            {this.state.person.users}
            </h1>
        </div>)
    }
}
